function AoMenuShow(){document.querySelectorAll(".ao-any-click-hover-show-child__open").forEach(e=>{e.addEventListener("click",()=>{let o=e.closest(".ao-any-click-hover-show-child").parentElement.querySelectorAll(".ao-any-click-hover-show-child__child"),c=e.parentElement.querySelector(".ao-any-click-hover-show-child__child");o.forEach(e=>{e===c?c.classList.toggle("ao-any-click-hover-show-child_open"):e.classList.remove("ao-any-click-hover-show-child_open")})})})}export default AoMenuShow;